Let $F$ be the cost of feathers per pound and $G$ be the cost of gold per ounce. 

From the given information, we can create a system of equations:
\begin{align*}
8F + 16G &= 932 \\
14F + 48G &= 1402 
\end{align*}

To solve the system, we will multiply the first equation by $7$ to match the $14F$ term:
\begin{align*}
56F + 112G &= 6524 \\
14F + 48G &= 1402 
\end{align*}

Then, we subtract the second modified equation from the first modified equation:
\begin{align*}
56F - 14F + 112G - 48G &= 6524 - 1402 \\
42F + 64G &= 5122 \\
\end{align*}

Now we have a system of two linear equations:
\begin{align*}
42F + 64G &= 5122 \\
14F + 48G &= 1402
\end{align*}

Solving this system of equations, we get $F = 58$ and $G = 17$. 

The cost of five pounds of feathers and five ounces of gold is 
$$5F + 5G = 5(58) + 5(17) = \boxed{375}$$

