&= 107
\end{align*}

Finally, to obtain the value of $f(10) - f(9)$:
\begin{align*}
f(10) - f(9) &= 127 - 107 \\
&= 20
\end{align*}

Therefore, $\boxed{f(10) - f(9) = 20}$.

