To find the smallest distance between the origin and a point on the parabola $y=x^2-5$, we first find the distance between a generic point $(x,x^2-5)$ on the parabola and the origin. Using the distance formula, the distance $d$ is given by:
\[d = \sqrt{x^2 + (x^2-5)^2} = \sqrt{x^2 + x^4 - 10x^2 + 25} = \sqrt{x^4 - 9x^2 + 25}\]
To minimize $d$, we can complete the square inside the square root:
\begin{align*}
d &= \sqrt{x^4 - 9x^2 + 25} = \sqrt{(x^4 - 9x^2 + \frac{81}{4}) - \frac{81}{4} + 25} \\
&= \sqrt{(x^2 - \frac{9}{2})^2 + \frac{19}{4}}
\end{align*}
Clearly, $(x^2 - \frac{9}{2})^2$ is minimized at $x=\frac{9}{2}$ for a positive real number $x$, making $x^2 - \frac{9}{2} = 0$.  Plugging $x=\frac{9}{2}$ back into $d$:
\[d = \sqrt{(\frac{9}{2})^2 + \frac{19}{4}} = \sqrt{\frac{81}{4} + \frac{19}{4}} = \sqrt{\frac{100}{4}} = \frac{10}{2} = \frac{5}{1}\]
