We are given that in an arithmetic sequence, the 7th term is $30$ and the 11th term is $60.$ Let $a$ be the first term of the sequence and $d$ be the common difference.

The general formula for the $n$th term of an arithmetic sequence is $a_n = a + (n-1)d.$

Using this formula, we have
\begin{align*}
a_7 &= a + 6d = 30, \\
a_{11} &= a + 10d = 60.
\end{align*}

Subtracting the equation from $(n = 7)$ from the equation from $(n = 11),$ we have
\begin{align*}
10d - 6d &= 60 - 30, \\
4d &= 30, \\
d &= 7.5.
\end{align*}

Substitute $d = 7.5$ back into $a + 6d = 30$ to solve for $a:$
\begin{align*}
a + 6(7.5) &= 30, \\
a + 45 &= 30, \\
a &= -15.
\end{align*}

Therefore, the first term of the sequence is $-15$ and the common difference is $7.5.$ The formula for the $n$th term of the arithmetic sequence is $a_n = -15 + (n-1)(7.5).$ Thus, the $21$st term is
\begin{align*}
a_{21} &= -15 + 20(7.5) = 135.
\end{align*}
The $21$st term of the sequence is $\boxed{135}.$

